import React from "react";
import "./create.css";

export const Choose = ({ photo, onImageClick }) => {
  return (
    <>
      <div className="choosen">
        <img
          key={photo._id}
          src={photo.picture}
          alt={`pixel`}
          onClick={() => onImageClick(photo)}
        />
        <button className="button">rem</button>
      </div>
    </>
  );
};
